import React from "react";
import { useNavigate } from "react-router-dom";

export const Auth = ({ authenticate }) => {
  const navigate = useNavigate();
  const onClick = () => {
    authenticate();
    navigate("/");
  };

  return (
    <div>
      <h2>Authentication</h2>
      <button onClick={onClick}>Log In</button>
    </div>
  );
};
